'use strict';
let ADXFeedMessage = require('./ADXFeedMessage.js');
let DxFeedHandshakeData = require('./DxFeedHandshakeData.js');
class DxFeedHeartbeatData extends ADXFeedMessage {
    static get CHANNEL() { return "/meta/connect"; }
    error;
    successful;
    constructor() {
        super();
        this.channel = DxFeedHandshakeData.CHANNEL;
    }
    getError() {
        return this.error;
    }
    getSuccessful() {
        return this.successful;
    }
    static create(successful, error) {
        let result;
        result = new DxFeedHeartbeatData();
        result.successful = successful;
        result.error = error;
        return result;
    }
}
module.exports = DxFeedHeartbeatData
